import React,{ReactNode} from 'react'
import NavPane from './NavPane/NavPane';
import PropTypes from 'prop-types'

const mainStyle={
    background: "linear-gradient(45deg, #757575, #00649e, #757575)",
    minHeight:"150vh"
};

const mainContentStyle={
    float:"right",
    display: 'flex',
    backgroundColor: '#e6e6fa90',
    flexDirection: 'column',
    alignItems: 'stretch',
    height:"90vh",
    boxSizing: 'border-box',
    borderRadius:'20px',
    marginTop: '10px',
    fontSize: '16px',
    boxShadow: '0 10px 20px rgba(0,0,0,0.19), 0 6px 6px rgba(0,0,0,0.23)',
};
class Main extends React.Component {
    render() {
        return (
            <div className={"container-fluid"} style={mainStyle} >
                <NavPane></NavPane>
                <div className={"container-fluid"} style={mainContentStyle}>
                    <br></br>
                    <h1>Welcome to Our Website!</h1>
                    <img src={process.env.PUBLIC_URL + '/ims_home_pic7.png'}/>
                    <div style={{display: 'flex'}}>
                        <img style={{height:'300px', width:'350px'}} src={process.env.PUBLIC_URL + '/ims_home_pic3.png'}/>
                        <img style={{height:'300px', width:'350px'}} src={process.env.PUBLIC_URL + '/ims_home_pic3.png'}/>
                    </div>

                </div>
            </div>
        );
    }
}

Main.propTypes = {}

export default Main;
